from decimal import *

N = Decimal()
e = Decimal(3)
c = Decimal()

def int_to_ascii(put):
    put = hex(int(put))
    put = put[2:-1]
    out = ""
    for i in range(0, len(put), 2):
        out += chr(int(put[i : i + 2], 16))
    return out

getcontext().prec = 280
size = 4000
for i in range(size):
    j = pow(i * N + c, 1 / e)
    ans = int_to_ascii(j)
    if "pico" in ans:
        getcontext().prec = 700
        ans = int_to_ascii(pow(i * N + c, 1 / e))
        ans = ans[:-1]
        print(ans.strip() + "}")
        break
